import React from "react";
import styles from './LeftSideLogin.module.css';
import logingCardLogo from '../../images/logo/logo.jpg'

const LeftSideLogin = () => {
    return(
        <div className={styles.leftSideLoginWrapper}>
            <div className={styles.wrapperForCard}>
                <img src={logingCardLogo} alt="xuy"></img>
                <h1>Diagrams changed my life!</h1>
                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. A nexuya eto ne lorem ipsum xuipsum, a voobshe denis lox i diagrammu tvoi xuinya ebanaya</p>
                <div>
                <span>Denis Durbalov</span>
                <span>Warsaw PJATK</span>
                </div>
            </div>
        </div>
    );
}

export default LeftSideLogin;
